const ParkIcon = ({map, parks}) => {
  console.log(parks)

  return (
    <>
    {parks.map((park) => (
      <Marker key={park.id} map={map} >
        <div>
          <h2>{park.name}</h2>
        </div>
      </Marker>
    ))}
    </>
  )
}

export default ParkIcon
